import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import logo from "../assets/logo.png";

export default function LanguagePage() {
  const navigate = useNavigate();
  const [selectedLang, setSelectedLang] = useState(null);
  const [showConfirm, setShowConfirm] = useState(false);

  const texts = {
    ar: {
      title: "اختر اللغة",
      confirmTitle: "تأكيد اختيار اللغة",
      message:
        "إن اللغة التي تم اختيارها هي اللغة التي سيتم عرضها في التطبيق، ويمكن للمستخدم تغيير اللغة في أي وقت من خلال لوحة التحكم.",
      confirm: "تأكيد",
      cancel: "إلغاء",
    },
    en: {
      title: "Choose Language",
      confirmTitle: "Confirm Language",
      message:
        "The selected language will be used throughout the application. You can change it anytime from the control panel.",
      confirm: "Confirm",
      cancel: "Cancel",
    },
    fr: {
      title: "Choisir la langue",
      confirmTitle: "Confirmer la langue",
      message:
        "La langue sélectionnée sera utilisée dans toute l'application. Vous pouvez la modifier à tout moment depuis le panneau de contrôle.",
      confirm: "Confirmer",
      cancel: "Annuler",
    },
  };

  const t = texts[selectedLang || "ar"];

  const chooseLanguage = (lang) => {
    setSelectedLang(lang);
    setShowConfirm(true);
  };

  const confirmLanguage = () => {
    localStorage.setItem("language", selectedLang);
    navigate("/auth");
  };

  return (
    <div style={styles.page}>
      {/* CSS محلي للأنيميشن */}
      <style>{`
        @keyframes fadeOverlay {
          0% { opacity: 0; }
          20% { opacity: 0.4; }
          80% { opacity: 0.4; }
          100% { opacity: 0; }
        }
      `}</style>

      {/* الشفافية الكحلية */}
      <div style={styles.overlay} />

      {/* المحتوى */}
      <div style={styles.content}>
        {/* اللوجو */}
        <div style={styles.logoWrapper}>
          <img src={logo} alt="logo" style={styles.logo} />
        </div>

        {/* العناوين */}
        <h1 style={styles.title}>
          Choose Language / اختر اللغة
        </h1>
        <p style={styles.subtitle}>
          Choisir la langue
        </p>

        {/* الأزرار */}
        <button style={styles.button} onClick={() => chooseLanguage("ar")}>
          العربية
        </button>
        <button style={styles.button} onClick={() => chooseLanguage("en")}>
          English
        </button>
        <button style={styles.button} onClick={() => chooseLanguage("fr")}>
          Français
        </button>
      </div>

      {/* نافذة التأكيد */}
      {showConfirm && (
        <div style={styles.modalBackdrop}>
          <div style={styles.modal}>
            <h2 style={styles.modalTitle}>{t.confirmTitle}</h2>
            <p style={styles.modalText}>{t.message}</p>
            <div style={styles.modalActions}>
              <button style={styles.cancelBtn} onClick={() => setShowConfirm(false)}>
                {t.cancel}
              </button>
              <button style={styles.confirmBtn} onClick={confirmLanguage}>
                {t.confirm}
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

/* ================== Styles ================== */

const styles = {
  page: {
    minHeight: "100vh",
    backgroundColor: "#E3DAD0",
    position: "relative",
    overflow: "hidden",
    fontFamily: "sans-serif",
  },
  overlay: {
    position: "absolute",
    inset: 0,
    backgroundColor: "#1A365D",
    animation: "fadeOverlay 10s ease-in-out infinite",
    zIndex: 1,
  },
  content: {
    position: "relative",
    zIndex: 2,
    minHeight: "100vh",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    gap: "16px",
  },
  logoWrapper: {
    width: "170px",
    height: "170px",
    borderRadius: "50%",
    border: "3px solid #1A365D",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#E3DAD0",
    boxShadow: "0 10px 30px rgba(0,0,0,0.2)",
  },
  logo: {
    width: "120%",
    height: "120%",
    objectFit: "contain",
    transform: "scale(1.1)",
  },
  title: {
    color: "#1A365D",
    fontSize: "22px",
    fontWeight: "bold",
    marginTop: "10px",
  },
  subtitle: {
    color: "#1A365D",
    fontSize: "20px",
    fontWeight: "bold",
    marginBottom: "10px",
  },
  button: {
    width: "240px",
    padding: "14px",
    borderRadius: "30px",
    border: "none",
    backgroundColor: "#1A365D",
    color: "white",
    fontSize: "18px",
    fontWeight: "bold",
    cursor: "pointer",
  },
  modalBackdrop: {
    position: "fixed",
    inset: 0,
    backgroundColor: "rgba(0,0,0,0.4)",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    zIndex: 10,
  },
  modal: {
    backgroundColor: "white",
    borderRadius: "20px",
    padding: "20px",
    width: "90%",
    maxWidth: "360px",
    textAlign: "center",
  },
  modalTitle: {
    color: "#1A365D",
    fontSize: "18px",
    fontWeight: "bold",
    marginBottom: "10px",
  },
  modalText: {
    fontSize: "14px",
    color: "#555",
    marginBottom: "20px",
    lineHeight: "1.6",
  },
  modalActions: {
    display: "flex",
    gap: "10px",
  },
  cancelBtn: {
    flex: 1,
    padding: "10px",
    borderRadius: "12px",
    border: "1px solid #ccc",
    backgroundColor: "#f5f5f5",
    cursor: "pointer",
  },
  confirmBtn: {
    flex: 1,
    padding: "10px",
    borderRadius: "12px",
    border: "none",
    backgroundColor: "#1A365D",
    color: "white",
    cursor: "pointer",
  },
};
